 "html": "<div style=\"text-align:left; color:#000; \"><DIV STYLE=\"text-align:left;\"><SPAN STYLE=\"letter-spacing:0vh;color:#000000;font-family:Arial, Helvetica, sans-serif;\"><SPAN STYLE=\"color:#987b55;font-size:3.62vh;font-family:'Antonio';\"><B>Sejarah Pura</B></SPAN></SPAN></DIV><p STYLE=\"margin:0; line-height:1.74vh;\"><BR STYLE=\"letter-spacing:0vh;color:#000000;font-size:1.16vh;font-family:Arial, Helvetica, sans-serif;\"/></p><DIV STYLE=\"text-align:justify;\"><SPAN STYLE=\"letter-spacing:0vh;color:#000000;font-family:Arial, Helvetica, sans-serif;\"><SPAN STYLE=\"color:#999999;font-size:1.74vh;font-family:'Open Sans Semibold';\">Pura Khayangan Jagat Ntegana adalah sebuah Pura yang terletak di Desa Adat Tegal, Desa Darmasaba, Kabupaten Badung, Provinsi Bali. Nama pura Ntegana terdiri dari dua kata yaitu Nteg dan Gana. Nteg berarti kuat, teguh, sedangkan Gana sama dengan Ganesha. Pura ini sudah ada sejak jaman dahulu, namun karena terjadinya gempa bumi yang sangat dahsyat, maka semua bangunan yang ada di dalam pura ini hancur hanya tinggal bagian pondasinya saja. Pada saat akan membangun pura ini Kembali, wilayah tempat pura ini ditumbuhi oleh pohon yang cukup besar Bernama pohon kayu Kuang, hingga disebut sebagai Pura Batan Kuang.</SPAN></SPAN></DIV><DIV STYLE=\"text-align:justify;\"><SPAN STYLE=\"letter-spacing:0vh;color:#000000;font-family:Arial, Helvetica, sans-serif;\"><SPAN STYLE=\"color:#999999;font-size:1.74vh;font-family:'Open Sans Semibold';\"> </SPAN></SPAN></DIV><DIV STYLE=\"text-align:justify;\"><SPAN STYLE=\"letter-spacing:0vh;color:#000000;font-family:Arial, Helvetica, sans-serif;\"><SPAN STYLE=\"color:#999999;font-size:1.74vh;font-family:'Open Sans Semibold';\">Pada saat penebangan pohon itu ditemukan adanya Archa Ganesha. Arca ini diangkat dan dibuatkan sebuah palinggih berupa gedhong yang dinamai oleh masyarakat Gedhong Konci. Pura ini berdiri megah pada areal lingkungan persawahan yaitu tepatnya pada Subak Aban, dengan gaya aristektur yang khas mencerminkan perpaduan antara arsitektur Bali kuna dan arsitektur kekinian. Unsur arsitektur Bali kuna dapat dilihat pada ragam hias yang cenderung masih liar dan tajam, namun alami dan banyak terdapat adanya unsur binatang dan pola ragam manusia, maupun ragam hias raksasa. Sampai sekarang ragam hias itu masih dilestarikan pada palinggih prasada/candi sebagai pemujaan pokok di Pura Ntegana. </SPAN></SPAN></DIV><p STYLE=\"margin:0; line-height:1.74vh;\"><BR STYLE=\"letter-spacing:0vh;color:#000000;font-size:1.16vh;font-family:Arial, Helvetica, sans-serif;\"/></p></div>",
